Stepped out of my appartment 500mts loop and headed out on the roads to run with my favourite people!!!! There is nothing compared to the happiness you get after seeing your favourite group after 6 months. 

Today was an easy paced run. Did a 5.5kms run + 2kms walk concluded with strengthening at the end. Run felt moderate, with people around me pushing me to complete the target I had set. 

1 year back I was able to run 21kms. Now, after a break of one year, I can run only 5. But is gonna demotivate me? Ofcourse not! I need to train harder and become better than what I was before. It wont be easy at all, but i will make it happen!!! 
